with recursive inputs as(
  select ''::text as inputs
)



,split as (
  select regexp_split_to_table(inputs,'')::text as inputs
  from inputs
)
/*,id_split as (

  select row_number() over() as row_id, inputs as raw_inputs
  from split
)*/
,distinct_split as (select distinct inputs
                    from split
)
,bad_things as (select string_agg(d.inputs || d2.inputs,'|') as things_to_remove
                from distinct_split d
                  inner join distinct_split d2
                    on upper(d2.inputs) = upper(d.inputs)
                       and d2.inputs <> d.inputs
)
,recur(poly,runs) as (
  select regexp_replace(inputs,(select things_to_remove from bad_things),'','g') as poly,
    1 as runs
from inputs
  union all
      select regexp_replace(poly,(select things_to_remove from bad_things),'','g'),
        runs + 1
  from recur
  where 1=1
    and poly <> regexp_replace(poly,(select things_to_remove from bad_things),'','g')
    and runs <300
)
,part1 as (select
             *,
             lag(poly, 1)
             over (
               order by runs ) = poly,
             char_length(poly)
           from recur
)
,extra_distinct_split as(
  select distinct lower(inputs) as inputs
  from distinct_split
)

,removed_inputs as (select
                      d.inputs                                                              as removed_letter,
                      regexp_replace(i.inputs, d.inputs || '|' || upper(d.inputs), '', 'g') as inputs
                    from inputs i
                      full join extra_distinct_split d on true
)
,removed_recur(poly,removed_letter,runs) as (
  select regexp_replace(inputs,(select things_to_remove from bad_things),'','g') as poly,
    removed_letter,
    1 as runs
from removed_inputs
  union all
      select regexp_replace(poly,(select things_to_remove from bad_things),'','g'),
        removed_letter,
        runs + 1
  from removed_recur
  where 1=1
    and poly <> regexp_replace(poly,(select things_to_remove from bad_things),'','g')
    and runs <5000
)

select distinct on (removed_letter)
             *,
             lag(poly, 1)
             over ( partition by removed_letter
               order by runs ) = poly,
             char_length(poly)
           from removed_recur
order by removed_letter,runs desc
    ;
